import React from "react";
import notes from "..notes/";

function insertNotes(notes){
  return <Note  key = {notes.key}
    title = {notes.title}

 /> ;}
function Note() {
  return (
    <div className="note">
      <h1>This is the note title</h1>
      <p>This is the note content</p>
    </div>
  );
}

export {Note};
